import React, { children } from 'react';
import MagnifierButton from './magnificationbutton';

function Mapp() {
  return (
    <div>
      <h1>Items for Visually Impaired Users</h1>
      <MagnifierButton />
      {children}
    </div>
  );
}

export default Mapp;
